INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('blue ranger', 5, 'First visit here because of a recommendation from a friend. White coffee or something similar with that name, highly recommended to try. There is also Nasi Goreng with various variants and all of them are delicious. Fried noodles are also like that. If you want to try both, I recommend trying the Mix Box, it has Fried Rice and Fried Noodles. It''s really delicious. What''s a bit lacking is the Ramen, not really, but it''s normal because it''s not a ramen restaurant. But for everything else, it was very good. For the price, it''s standard cafe price, so it''s still reasonable. The place is comfortable, the toilets are clean, and the waiters are friendly. The parking lot is a bit difficult, but someone directed me to park on the shoulder of the road anyway.', 'Coffee', 'Positif', 'Sobat Coffee');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Ashe syamsuddin', 5, 'The location is strategic, the place is quite spacious and comfortable (downstairs). But when arisan visitors come, the atmosphere becomes uncomfortable and very noisy. Just a suggestion, maybe it''s better if the arisan place is separated, not combined with other visitors, because it will disturb other visitors.
